        \ title:\n    content: IETF\n    format: text/plain\nkeyword:\n- content:
        NETCONF RESTCONF\n- content: YANG\n- content: XML\neditorialgroup:\n- name:
        netconf\next:\n  schema-version: v1.0.1\n  stream: IETF\n"
